import React from "react";
import {useParams} from "react-router-dom";

export function DetailPatient () {
    const {id} = useParams()
    const { data, loading } = useQuery(
        QUERY_PATIENTS
    );
    if (loading) return <p>Loading...</p>;

    return data.patientById.map(
        <div>
            <p>{id}</p>
        </div>
    );
};
